import { useState } from 'react'
import imgCS from '../img/Games/Counter-Strike 2.png'
import imgFree_Fire from '../img/Games/Free Fire.png'
import imgGTA from '../img/Games/Grand Theft Auto V.png'
import imgMine from '../img/Games/Minecraft.png'

import styles from '../styles/VideoList.module.css'

const Games = [
	{
		name: 'Назва відео 1',
		duration: 15,
		ImageSrc: imgGTA,
		id: 1,
	},
	{
		name: 'Назва відео 2',
		duration: 15,
		ImageSrc: imgMine,
		id: 2,
	},
	{
		name: 'Назва відео 3',
		duration: 212,
		ImageSrc: imgCS,
		id: 3,
	},
	{
		name: 'Назва відео 4',
		duration: 1123,
		ImageSrc: imgFree_Fire,
		id: 4,
	},
]

export function VideoList({ details, setDetails }) {
	const [count, setCount] = useState(0)
	return (
		<>
			<h1 className={styles.FirstCLASS}> Games </h1>
			{Games.map(game => {
				return (
					<div key={game.id}>
						<img
							className={styles.GamesImg}
							src={game.ImageSrc}
							alt={game.name}
						/>
						<p>{game.name}</p>
						<p>{game.duration}</p>
						<button onClick={() => setCount(count => count + 1)}>sad</button>
						<p>{count}</p>
					</div>
				)
			})}
		</>
	)
}
